create table project_inputs
(
    id         serial               not null
        constraint project_fields_pk
            primary key,
    project_id varchar(30)
        constraint project_inputs_projects_id_fk
            references projects
            on update cascade on delete cascade,
    input_id   varchar(30)
        constraint project_inputs_inputs_id_fk
            references inputs
            on update cascade on delete cascade,
    "order"    smallint,
    visible    boolean default true not null
);

alter table project_inputs
    owner to postgres;

